window.bookSummaryJSON = "<p>Captain Alisa Marchenko finally has a lead on finding her daughter, but her passengers want her to take them on their quest instead. Even though the <i>Star Nomad</i> is her ship, they have power she cannot fight, and she finds herself with no choice but to accept another detour. </p> <p>But the ancient relic they seek has the ability to destroy worlds and is coveted by many. The path leading to it is riddled with competitors and littered with the dead, and even a cyborg and a Starseer may not be strong enough to fight the obstacles in the way. </p> <p>Swept up in a fate she never chose, Alisa must find a way to survive against impossible odds, knowing that if her passengers succeed, they will change the course of history - maybe not for the better. </p>"; 
